<!DOCTYPE HTML>
<html>
<!-- This version B0.15 is to get ready to publish on Github. -->
<!-- For sake of developer sanity, try to use the naming convention of TOPcube for cubes in the top section, and GAMEcube for cubes in the game/play section. -->
<!-- cubes in the top have IDs like 'c' (for Cube) row/cube col/face. -->
<!-- spaces in the bottom have IDs like 'g' (for Gamespace) row column of gamespace. -->
<!-- cubes in the bottom have IDs like 'cube' follooed by 'n' where 'n is the cube's number. -->
<!-- cubes in the JSON array have "cubeNbr:"  then n (n is from 0 to nbrOfCubes). -->
<!--
	Keep status of cubes in json ...

	'{ "cubes": [ // nbrOfCubes (e.g., 12 coubes)
					{
						"cubeNbr": "n", // which cube - 0 thru nbrOfCubes
						"faces": [ ], // 6 faces for each cube
						"points": [ ], // 6 point values for each cube
						"topFace": "n", // letter on top face of cube
						"topPoints": "n" // point value for letter on topFace of cube
						"row": "n", // row of the cube - 0 thru gameDimensions
						"col": "n", // column of the cube - 0 thru gameDimensions
						"hVal": "v/i/n", // v=part of valid horizontal word; i=part of invalid horizontal word; n=part of no horizontal word
						"vVal": "v/i/n", // v=part of valid vertical word; i=part of invalid vertical word; n=part of no vertical word
					}
				]
	}';

	When moving a tile, update the cube's row and col.
	When changing the face on a tile, update cube's topFace and topPoints.
	When computing score, update each cube's hVal and cVal.
-->

	/* this function controls what is visible in the top half ... */
	function displayTop (top) {
		var topDisplays = ['topHome', 'topRules', 'topChallenge', 'cubes'];
		for (i=0; i<topDisplays.length; i++) {
			if (top == topDisplays[i]) {

			} else {
				document.getElementById(topDisplays[i]).style.visibility='hidden';
			}
		}

	/* these functions are for drag and drop ... */

	  ev.preventDefault();
	}

	function drag(ev) {
	  ev.dataTransfer.setData("text", ev.target.id);
	}

	function drop(ev) {
	  ev.preventDefault();
	  var data = ev.dataTransfer.getData("text");
	  ev.target.appendChild(document.getElementById(data));
	  computeScore();
	}

	/* these functions are for highlighting which cube, and changing which face of the cube is used ... */
	function updateCubeFace(cube,face) {
		var stringCube = "cube" + cube;
		document.getElementById(stringCube).innerHTML = cubes[cube].faces[face] + "<div class='points'>" + cubes[cube].points[face] + "</div></div>";
		// now update the cube face and points in the cubes array ...
		for (i=0; i< nbrOfCubes; i++) {
			if (cubes[i].cubeNbr == cube) {
				//cubes[i].topFace =  document.getElementById('c' + cube + face).innerHTML;
				//cubes[i].topPoints =  document.getElementById('c' + cube + face).innerHTML   ;
				var str = document.getElementById('c' + cube + face).innerHTML;
				if (str.substr(0,1) == "Q") {
					cubes[i].topFace = "Qu";
				}
				else {
					cubes[i].topFace = str.substr(0,1);
				}
				cubes[i].topPoints = document.getElementById('p' + cube + face).innerHTML; 		
				break;  
			}
		}
		computeScore();
	}

	function highlightCubeRow(i) { // i is row/topCube to be highlighted; 
		displayTop('cubes');
		/* first make all the cubes in the top section be colorGoodWord ... */
		for (r=0; r < nbrOfCubes; r++) {
			for (c=0; c < 6; c++) { // each cube has 6 faces.
				stringCell = "c" + r + c; 
				document.getElementById(stringCell).style.background = colorGoodWord;
			}
		}
		/* Now make the row of the double-clicked cube be highlighted ... */
		for (k=0; k<6; k++) {
			stringCell = "c" + i + k;
			document.getElementById(stringCell).style.background = colorHighlight; // green
		}
	}

	function highlightCube(cubeNbr) { // This changes the color of a cube in the game/play space based on mouseover of cubes in the top space. 
		var stringCube = "cube" + cubeNbr;
		document.getElementById(stringCube).style.background = colorHighlight;
	}

	function unhighlightCube(cubeNbr) { /* This changes the color of a cube back to its color based it's valid/invalid color determined by computeScore(). */
		var newColor = "";
		if (cubes[cubeNbr].hVal == 'n' && cubes[cubeNbr].vVal=='n') {
			newColor = colorGoodWord;
		}
		else if (cubes[cubeNbr].hVal == 'v' && cubes[cubeNbr].vVal=='i') {
			var newStyle = "background-image: linear-gradient(90deg, #ffcc00 25%, #c0c0c0 25%, #c0c0c0 50%,#ffcc00 50%, #ffcc00 75%, #c0c0c0 75%, #c0c0c0 100%); background-size: 12.00px 12.00px;";
		}
		else if (cubes[cubeNbr].hVal == 'i' && cubes[cubeNbr].vVal=='v') {
			var newStyle = "background-image: linear-gradient(0deg, #ffcc00 25%, #c0c0c0 25%, #c0c0c0 50%, #ffcc00 50%, #ffcc00 75%, #c0c0c0 75%, #c0c0c0 100%); background-size: 12.00px 12.00px;";
		}
		else if (cubes[cubeNbr].hVal == 'v' && cubes[cubeNbr].vVal=='n') {
			newColor = colorGoodWord;
		}	
		else if (cubes[cubeNbr].hVal == 'n' && cubes[cubeNbr].vVal=='v') {
			newColor = colorGoodWord;
		}
		else if (cubes[cubeNbr].hVal == 'n' && cubes[cubeNbr].vVal=='i') {
			newColor = colorBadWord;
		}
		else if (cubes[cubeNbr].hVal == 'i' && cubes[cubeNbr].vVal=='n') {
			newColor = colorBadWord;
		}
		else if (cubes[cubeNbr].hVal == 'i' && cubes[cubeNbr].vVal=='i') {
			newColor = colorBadWord;
		}	
		else { // v and v ...
			newColor = colorGoodWord;
		}
		var stringCube = "cube" + cubeNbr;	
		if (newColor != "") {
			document.getElementById(stringCube).style.background = newColor;
		}
		else {
			document.getElementById(stringCube).style = newStyle;
		}
}

var words = JSON.parse(unparsedWords);

function computeScore() {
	// first refresh the cube positions ...
	for (r=0; r < gameDimensions; r++) {
		for (c=0; c < gameDimensions; c++) {
			if (document.getElementById('g' + r + c).innerHTML != "") { // if the game cell is not empty ...
				var unparsedGameCell = document.getElementById('g' + r + c).innerHTML;
				var theOffset = unparsedGameCell.search('id="cube') + 8;  
				var theCubeNbr = unparsedGameCell.substr(theOffset,2);  
 				if (isNaN(theCubeNbr)) {
					theCubeNbr = theCubeNbr.substr(0,1);
				}
				cubes[theCubeNbr].row = r;
				cubes[theCubeNbr].col = c;
			}
		}
	}
	var totalScore = 0;
	// Now find the horizontal words ...
	var theWord = "";
	var theWordCubes = [];
	var theWordScore = 0;
	for (r=0; r < gameDimensions; r++) {  // gameDimensions
		for (c=0; c < gameDimensions; c++) {
			if (document.getElementById('g' + r + c).innerHTML != "") { // if the game cell is not empty ...
				for (i=0; i<nbrOfCubes; i++) { // find which cube is at this r and c ...
					if(cubes[i].row == r && cubes[i].col == c) { // this (i) is the cube ...
						theWord += cubes[i].topFace;
						theWordCubes.push(i);
						theWordScore = parseInt(theWordScore) + parseInt(cubes[i].topPoints);
					}
				}
			}
			if (document.getElementById('g' + r + c).innerHTML == "" || c == parseInt(gameDimensions)-1) { // cell empty or last cell in row ...
				if (theWordCubes.length > 0) { // the end of word still needs to be processed ... (using theWordCubes instead of theWord avoids the problem of 2 letter on one face (i.e. Qu)).
					if (theWordCubes.length > 1) { // at least 2 letters needed for a valid word.
						theWord = theWord.toLowerCase();
						if (words[theWord] == 1) { // if it's a valid word (in the words list) ...
							for (j=0; j < theWordCubes.length; j++) { // mark the cubes as being in a valid word ...
								cubes[theWordCubes[j]].hVal = "v";
							} 
							totalScore = parseInt(totalScore) + parseInt(theWordScore);
						}
						else { // the word is not in the valid word list ...
							for (j=0; j < theWordCubes.length; j++) { // mark the cubes as being in an invalid word ...
								cubes[theWordCubes[j]].hVal = "i";
							}
							totalScore = parseInt(totalScore) - parseInt(theWordScore);
						}
					}
					else { // there was just a single letter, so it was not part of a horizontal word ...
						// cubes[j].hVal = "n";
						cubes[theWordCubes[0]].hVal = "n";
					}
				}
				// reset stuff to prep for the next word ...
				theWord = "";
				theWordCubes = [];
				theWordScore = 0;
			}
		}
	}
	// Now find the vertical words ...
	var theWord = "";
	var theWordCubes = [];
	var theWordScore = 0;
	for (c=0; c < gameDimensions; c++) {  // gameDimensions
		for (r=0; r < gameDimensions; r++) {
			if (document.getElementById('g' + r + c).innerHTML != "") { // if the game cell is not empty ...
				for (i=0; i<nbrOfCubes; i++) { // find which cube is at this r and c ...
					if(cubes[i].row == r && cubes[i].col == c) { // this (i) is the cube ...
						theWord += cubes[i].topFace; 
						theWordCubes.push(i);
						theWordScore = parseInt(theWordScore) + parseInt(cubes[i].topPoints);
					}
				}
			}
			if (document.getElementById('g' + r + c).innerHTML == "" || r == parseInt(gameDimensions)-1) { // cell empty or last cell in column ...
				if (theWordCubes.length > 0) { // the end of word still needs to be processed ... (using theWordCubes instead of theWord avoids the problem of 2 letter on one face (i.e. Qu)).
					if (theWordCubes.length > 1) { // at least 2 letters needed for a valid word.
						theWord = theWord.toLowerCase();
						if (words[theWord] == 1) { // if it's a valid word (in the words list) ...
							for (j=0; j < theWordCubes.length; j++) { // mark the cubes as being in a valid word ...
								cubes[theWordCubes[j]].vVal = "v";
							} 
							totalScore = parseInt(totalScore) + parseInt(theWordScore);
						}
						else { // the word is not in the valid word list ...
							for (j=0; j < theWordCubes.length; j++) { // mark the cubes as being in an invalid word ...
								cubes[theWordCubes[j]].vVal = "i";
							}
							totalScore = parseInt(totalScore) - parseInt(theWordScore);
						}
					}
					else { // there was just a single letter, so it was not part of a horizontal word ...
						// cubes[j].hVal = "n";
						cubes[theWordCubes[0]].vVal = "n";
					}
				}
				// reset stuff to prep for the next word ...
				theWord = "";
				theWordCubes = [];
				theWordScore = 0;
			}
		}
	}
	for (i=0; i < nbrOfCubes; i++) { // Update the colors of the GameCubes (highlight invalid words)...
		unhighlightCube(i);
	}
	document.getElementById("scoreSpan").innerHTML = totalScore;  // Display the score 
	// document.getElementById("scoreSpan").innerHTML = totalScore + " <br> " + JSON.stringify(cubes); 
	
	//document.getElementById('challengeSpan').innerHTML = challengeSomeoneWithTheseCubes.fontsize(1);
	document.getElementById('challengeString').value = challengeSomeoneWithTheseCubes;
	
} // end of computeScore()

function copyChallengeText() {
	// var copyText = document.getElementById("challengeSpan").innerHTML;
	var copyText = document.getElementById("challengeString");
	
	// copyText.value = "HoHoHo HoHoHo \n" + copyText.value + "\nHe He He He ";
	
	copyText.value = "Here's a fun new game. I challenge you to try to beat my score of " + document.getElementById("scoreSpan").innerHTML + " points.      Challenge String: " + copyText.value + "      Get the game at https://schleiff.github.io, click the 'Accept a Challenge' button, and paste in the Challenge String (the string of capital letters) from this message.                                                                                                                                   NOTE 1: This game is just JavaScript. You can view source, save the source as a .html file, and browse the file from your local device -- no internet needed!                                                                                                                  NOTE 2: If anyone can help make this app work for APK/Android and/or iOS/Apple, please email marty at mlscarshop@gmail.com";
	
	copyText.select();
	copyText.setSelectionRange(0, 99999)
	document.execCommand("copy");
	alert("Copied the text: " + copyText.value);
	
	// this deselect idea is from https://www.thewebflash.com/select-or-deselect-text-inside-an-element-using-js/
	var element = document.activeElement;
	if (element && /INPUT|TEXTAREA/i.test(element.tagName)) {
		if ('selectionStart' in element) {
		  element.selectionEnd = element.selectionStart;
		}
		element.blur();
	}

	if (window.getSelection) { // All browsers, except IE <=8
		window.getSelection().removeAllRanges();
	} else if (document.selection) { // IE <=8
		document.selection.empty();
	}
}
